import React, { useState } from "react";
import "./services.css";

const Services = () => {
  const [toggleState, setToggleState] = useState(0);
  const toggleTab = (index) => {
    setToggleState(index);
  };

  return (
    <section className="services section" id="projects">
      <h2 className="section__title">Services</h2>
      <span className="section__subtitle">My Personal Projects</span>

      <div className="services__container container grid">
        <div className="services__content">
          <div>
            <i className="uil uil services__icon"></i>
            <h3 className="services__title"></h3>
          </div>

          <span className="services__button">
            View More{" "}
            <i
              className="uil uil-arrow-right 
                    services__button-icon"
            ></i>
          </span>

          <div className="services__model">
            <div className="services__model-content">
                <i className="uil uil-times services__model-close"></i>

                <h3 className="services__model-title"></h3>
                <p className="services__model-description"></p>
            </div>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Services;
